import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  Image,
  ActivityIndicator,
} from "react-native";
import React, { useEffect, useState } from "react";
import { SafeAreaView } from "react-native-safe-area-context";
import { LinearGradient } from "expo-linear-gradient";
import { storeColors } from "../theme";
import Offer from "../components/Offer";
import { useNavigation } from "@react-navigation/native";
import AsyncStorage from "@react-native-async-storage/async-storage";
import axios from "axios";
import { useIsFocused } from "@react-navigation/native";

export default function UserOffers() {
  const navigation = useNavigation();
  const [data, setData] = useState();
  const isFocused = useIsFocused();
  const [loading, setLoading] = useState(false);
  const [id, setId] = useState("");
  const [labor, setLabor] = useState("");
  const [price, setPrice] = useState("");
  const [reqId, setReqid] = useState("");
  axios.defaults.withCredentials = true;
  useEffect(() => {
    if (isFocused) {
      getValueFromAsyncStorage();
    }
  }, [isFocused]);
  async function getValueFromAsyncStorage() {
    try {
      const value = await AsyncStorage.getItem("id");
      if (value !== null) {
        setId(value);
        getData(value);
      } else {
        await AsyncStorage.clear();
        navigation.navigate("Login");
      }
    } catch (error) {
      console.log(error);
    }
  }
  if (!data) {
    return (
      <View className="flex justify-center items-center w-full h-full z-40 absolute">
        <ActivityIndicator size="large" color="#0000ff" />
      </View>
    );
  }
  const calculateAverageStars = (feedbackData, sender) => {
    let totalStars = 0;
    let count = 0;

    feedbackData.forEach((feedback) => {
      if (feedback.receiver === sender) {
        totalStars += parseInt(feedback.stars);
        count++;
      }
    });

    const averageStars = count === 0 ? 0 : totalStars / count;
    return averageStars;
  };
  function getData(value) {
    axios
      .get(`/proposal/`, {
        params: {
          user: value,
        },
      })
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }
  return (
    <LinearGradient
      colors={["rgba(58, 131, 244,0.4)", "rgba(9, 181, 211, 0.4)"]}
      className="w-full flex-1"
    >
      <SafeAreaView>
        <View className="container">
          <View className="mt-3 space-y-4">
            <Text
              style={{ color: storeColors.text }}
              className="ml-4 text-3xl font-bold"
            >
              User Offers
            </Text>
          </View>

          <View className="mt-3">
            <View className="flex-row justify-between items-center mb-2"></View>
            <ScrollView
              showsVerticalScrollIndicator={false}
              contentContainerStyle={{ paddingBottom: 20 }}
            >
              {data.map((item, index) => {
                let total = 0;
                total = calculateAverageStars(
                  item.labor.Feedback,
                  item.labor._id
                );
                console.log(total);
                return (
                  <TouchableOpacity
                    key={index}
                    onPress={() =>
                      navigation.navigate("Single", {
                        labor: item.labor,
                        reqId: item.reqId._id,
                        price: item.price,
                        id,
                        total,
                      })
                    }
                  >
                    <Offer
                      name={item.labor.name}
                      title={item.reqId.title}
                      desc={item.description}
                      type={item.rateType}
                      budget={item.price}
                      image={item.labor.image}
                      total={total}
                    />
                  </TouchableOpacity>
                );
              })}
            </ScrollView>
          </View>
        </View>
      </SafeAreaView>
    </LinearGradient>
  );
}
